export default (function(a,b,c,d,e,f,g,h,i){return {data:{lFsQsEtdWX:{data:{id:412,attributes:{imdbId:"tt0043359",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDA4MjE4ZWYtNTg0Yi00MmRlLTg4ZDEtOTEzMWRlMzgzMjY2XkEyXkFqcGdeQXVyMTIxMDUyOTI@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1075,attributes:{title:b,plot:"Bullfighter Luis Bello (Mel Ferrer) is a star, but fear and doubt strike quickly after he is injured in the ring. Manager Raul Fuentes (Anthony Quinn) refuses to let him give up, though, pushing Luis to overcome his doubt and remain a matador. Luis agrees, but complications ensue when he falls for Raul's girlfriend, Linda (Miroslava). Things get even worse after a tragic accident and a public embarrassment. Now, to salvage his dignity, Luis needs one last shot in the ring.",slug:"the-brave-bulls"}}},books:{data:[{id:3433,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:true,published:g,publisher:h,subtitle:a}},{id:3434,attributes:{title:b,description:e,thumbnail:f,authors:[c],firstBook:d,published:g,publisher:h,subtitle:a}},{id:3435,attributes:{title:b,description:"Action and glory of a matador, the idol of the bull ring.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=1hAxAAAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:d,published:"1949-01-01",publisher:a,subtitle:i}},{id:3436,attributes:{title:b,description:a,thumbnail:a,authors:[c],firstBook:d,published:"1951-01-01",publisher:a,subtitle:"A Novel ; Illustrated by the Author"}},{id:3437,attributes:{title:b,description:a,thumbnail:a,authors:[c,"Robert reader Ramirez"],firstBook:d,published:"2002-01-01",publisher:a,subtitle:i}}]}}},meta:{}}},prerenderedAt:1680940930324}}("","The Brave Bulls","Tom Lea",null,"One of Texas's true renaissance men, Tom Lea (1907-2001) was already a noted artist, muralist, and book illustrator when he published his first novel, The Brave Bulls, in 1949. This suspenseful story of bullfighting in Mexico, elegantly illustrated by the author, spent several weeks on the New York Times bestseller list and was hailed by Time magazine as the best first novel of the year. It also won the Carr P. Collins Award from the Texas Institute of Letters, went through numerous reprints and translations, and became a 1951 movie starring Mel Ferrer and Anthony Quinn.","https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=YB96EKbwQcEC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","2002-05-15","University of Texas Press","A Novel"))